  return (
    <HeroContainer>
      <HeroBlank></HeroBlank>
      <HeroActive>

        {page ? 
        (<AboutSection setPage={setPage}/> ,<SwiperSection  />): <SwiperSection />
        }
        {/* {page && <AboutSection  setPage={setPage}/>}
        {!page  && <SwiperSection />} */}
      </HeroActive>
    </HeroContainer>
  );
};
export default HeroSection;
